export async function fetchMockData(): Promise<any> {
    try {
        const response = await fetch('/mockDataUsers.json');

        if (!response.ok) {
            throw new Error(`Erreur lors de la requête : ${response.status}`);
        }

        const data: any = await response.text(); // Utilisez response.text() au lieu de response.json()
        const jsonData = JSON.parse(data);

        console.log('Données récupérées avec succès:', jsonData);
        return jsonData;
    } catch (error) {
        console.error('Erreur lors de la récupération des données:', (error as Error).message);
        throw error;
    }
}
